  Future<List<News>> getNews() async {
    List<News> news = [];

    await FirebaseFirestore.instance
        .collection("news")
        .get()
        .then((QuerySnapshot querysnapshot) {
      for (var m in querysnapshot.docs) {
        news.add(
          News(
            text: m.get('text'),
            time: m.get('time'),
            title: m.get('title'),
            imageUrl: m.get('imageUrl'),
          ),
        );
      }
    });
    return news;
  }

